pub fn get_oracle_root_grammar_id() -> GrammarId {
    GrammarId(1978)
}
pub fn get_oracle_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_oracle_root_grammar_id(),
        tables: &ORACLE_TABLES,
    }
}
pub fn get_oracle_root_grammar() -> RootGrammar {
    get_oracle_root_grammar_table()
}
